INSERT INTO `book_infos` (`id`, `author`, `long_description`, `language`, `created_at`, `updated_at`) VALUES
(751, 'By Tess Mallos', '<p>With recipes from Greece, Turkey, Lebanon, Egypt, Syria, and even lesser known cuisines from Afghanistan, Armenia, Cyprus, Iran, Jordan, Saudi Arabia, Bahrain, Kuwait, Oman, Qatar, the United Arab Emirates, and Yemen, this book is truly a wonderful compilation of some of the most delicious Middle Eastern foods. Each chapter in this book examines the customs and cooking methods of each country illustrated by full-page color photos. The book also includes a glossary of regional names and descriptions of foods and ingredients.</p>', 'Written in English', '2019-04-09 19:42:07', '2019-04-09 19:42:07'),
(752, 'By Dawn, Elain & Selwa Anthony', '<p>The Lebanese Cookbook offers a comprehensive range of authentic Lebanese recipes including favorite dishes like Tabbouleh salad, Hummus b&#39;Tahini, Falafel, and Baba Ghanouj. Beautifully designed with full-page color photographs. The Lebanese Cookbook also provides an insight into the lifestyle, customs and culinary traditions of Lebanon.</p>', 'Written in English', '2019-04-09 21:44:42', '2019-04-09 21:44:42'),
(753, 'By Tess Mallos', '<p>North African Cooking book will show how easy it is to prepare traditional and authentic dishes from Egypt, Algeria, Libya, Tunisia and Morocco. This beautiful book includes an introduction to North African history and culture, and information on ingredients, equipment, and cooking technique to make its dishes accessible for all to enjoy.</p>', 'Written in English', '2019-04-09 22:01:07', '2019-04-09 22:01:07'),
(754, 'By Tess Mallos', '<p>Turkish Cooking explores the healthy, nutritious and delicious recipes inspired by this tradition, including such authentic favorites as Turkish Delight, Baklava and Braised Lamb. From fresh seafood to spicy meat skewers, stuffed vegetables to lots of nuts, grains, olives, figs and fruits. All these electrifying dishes are perfectly suited to the conscious cook.</p>', 'Written in English', '2019-04-09 22:02:08', '2019-04-09 22:02:08'),
(755, 'By Sima Osman Yassine and Sadouf Kamal', '<p>With more than 460 fabulous recipes, and more than 240 full-color photographs. Alef baa tabkh covers all the tips necessary to make Middle Eastern cooking a very simple and enjoyable experience. Easy to follow instructions and a wide range of selections such as recipes for appetizers, salads, soups, rice and pasta dishes, poultry, fish and meat, vegetables, savory pies, preserves, desserts and more. This book also lists the name of spices, vegetables and fruits in Arabic, English and French, with a detailed description of how to purchase the best ingredients and how to maintain their freshness.</p>', 'Written in Arabic', '2019-04-09 22:02:58', '2019-04-09 22:02:58'),
(756, 'By Sima Osman Yassine and Sadouf Kamal', '<p>From all over the world, the world sweet book presents 290 recipes to satisfy your sweetooth.Delecatable desserts that have a blend of the east and west in a subtle and beautiful manner. Recipes include pies, cakes, chocolate desserts, baklava, walnut and date cookies, knaafeh (string pastry with cheese), awwamat (dough balls in syrup), turmeric cake, walnut pancakes, mouhallabia bill burtukal (milk pudding with oranges), basbousa (semolina cake), and more.</p>', 'Written in Arabic', '2019-04-09 22:04:05', '2019-04-09 22:04:05');
